    //El administrador retira
    function withdrawAdmin()external onlyOwner{
        require(block.number>POINT,'Not the time yet');

        uint256 totalAmount=address(this).balance;

        (bool sent, ) = msg.sender.call{value:totalAmount}("");
        require(sent,"No cool withdraw");
        POINT=block.number+MONTH;
        //La BOVEDA esta vacia
    }

    //El lider retira su dinero
    function withdrawLeader()external{
        require(isLeader[msg.sender],'has to be a leader');
        require(leaderBalance[msg.sender]>0,'leader balance cannot be 0');
        require(block.number>POINT,'Not the time yet');

        uint256 totalAmount=leaderBalance[msg.sender];

        //Filtro de exito
        //si el lider alcanzo mas de 100 ventas
        //dar recompenza
        if(leaderCounter[msg.sender]>99){
            totalAmount=totalAmount+leaderBalanceReward[msg.sender];
        }else{
            //El lider no alcanzo el objetivo
            //La BOVEDA guarda las reservas que no fueron reclamadas
            BOVEDA=BOVEDA+leaderBalanceReward[msg.sender];

        }
        //Envio el pago
        (bool sent, ) = msg.sender.call{value:totalAmount}("");
        require(sent,"Fail in the withdraw");

        //Si el pago es exitoso, actualizar todos los balances.
        //Reset del total de balances
        leaderCounter[msg.sender]=0;
        leaderBalance[msg.sender]=0;
        leaderBalanceReward[msg.sender]=0;

    }




